import{_ as s,o as a,c as n,f as t}from"./app.a206cc99.js";const e="/documentation/images/station_images/airflow_login.png",o="/documentation/images/station_images/airflow_ui.png",l="/documentation/images/station_images/test_config_dag.png",i="/documentation/images/station_images/task_logs.png",r="/documentation/images/station_images/task_log_details.png",p="/documentation/images/station_images/trigger_run_train.png",_=JSON.parse('{"title":"Usage","description":"","frontmatter":{},"headers":[{"level":2,"title":"Getting started with Airflow","slug":"getting-started-with-airflow","link":"#getting-started-with-airflow","children":[{"level":3,"title":"Login","slug":"login","link":"#login","children":[]},{"level":3,"title":"Triggering the test DAG","slug":"triggering-the-test-dag","link":"#triggering-the-test-dag","children":[]},{"level":3,"title":"Accessing logs","slug":"accessing-logs","link":"#accessing-logs","children":[]},{"level":3,"title":"Running a train","slug":"running-a-train","link":"#running-a-train","children":[]},{"level":3,"title":"Running a train with volume data","slug":"running-a-train-with-volume-data","link":"#running-a-train-with-volume-data","children":[]}]}],"relativePath":"guide/station/usage.md"}'),c={name:"guide/station/usage.md"},g=t('<h1 id="usage" tabindex="-1">Usage <a class="header-anchor" href="#usage" aria-hidden="true">#</a></h1><h2 id="getting-started-with-airflow" tabindex="-1">Getting started with Airflow <a class="header-anchor" href="#getting-started-with-airflow" aria-hidden="true">#</a></h2><p>Trains and other station tasks are executed via airflow DAGs. The DAGs can be triggered via the airflow web interface, which is available under port <code>:8080</code> on the station machine. The execution of the DAGs can also be monitored in the webinterface.</p><h3 id="login" tabindex="-1">Login <a class="header-anchor" href="#login" aria-hidden="true">#</a></h3><p>The first time you access the webinterface you will be prompted to log in. Enter the credentials set in the <code>.env</code> file to login as admin. Or use the credentials that you have obtained from the station administrator.</p><p><a href="/images/station_images/airflow_login.png"><img src="'+e+'" alt="image"></a></p><h3 id="triggering-the-test-dag" tabindex="-1">Triggering the test DAG <a class="header-anchor" href="#triggering-the-test-dag" aria-hidden="true">#</a></h3><p>To test the configuration of the station as defined in the <code>.env</code> file, trigger the DAG named <code>test_station_configuration</code> in the user interface.<br> A DAG is triggered in the UI by clicking on the <strong>play</strong> button, where it can be started either with or without a json file containing additional configuration for the DAG run.</p><p><a href="/images/station_images/airflow_ui.png"><img src="'+o+'" alt="image"></a></p><p>Trigger the DAG without any additional configuration to check if the station is properly configured. A notification should appear in the UI that the DAG has been triggered.</p><p>To monitor the execution click on the name of the DAG. You should see the individual tasks contained in the DAG as well as their status in the UI. If all tasks are marked as success, the station is properly configured and can connect to harbor as well as a FHIR server.</p><p>!!! warning If you did not provide any FHIR_Server configurations in the .env-file, then this Trigger will fail, because this test will try to connect to the FHIR_server. All the nodes will be marked as red or orange except the &quot;get_dag_config&quot;</p><p><a href="/images/station_images/test_config_dag.png"><img src="'+l+'" alt="image"></a></p><h3 id="accessing-logs" tabindex="-1">Accessing logs <a class="header-anchor" href="#accessing-logs" aria-hidden="true">#</a></h3><p>The logs stored during the execution of a DAG can be accessed for each individual task by clicking the colored,squared/circled - indicator next to the name of the task. In the new pop-up window you can see in the top a list of options. There you can pick <strong>Log</strong> to view the Log of this task.</p><p><a href="/images/station_images/task_logs.png"><img src="'+i+'" alt="image"></a></p><p>If there are any errors stacktraces can be found in these logs, as well as any other output of the tasks (stdout, stderr)</p><p><a href="/images/station_images/task_log_details.png"><img src="'+r+`" alt="image"></a></p><h3 id="running-a-train" tabindex="-1">Running a train <a class="header-anchor" href="#running-a-train" aria-hidden="true">#</a></h3><p>To execute a train that is available for your station, trigger the <code>run_train</code> DAG, with configuration options specifying the train image to be pulled from harbor and executed as well as additional environment variables or volumes. A template train configuration is displayed below.</p><div class="language-json"><button class="copy"></button><span class="lang">json</span><pre><code><span class="line"><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">repository</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">&lt;HARBOR-REGISTRY&gt;/&lt;STATION_NAMESPACE&gt;/&lt;TRAIN-IMAGE&gt;</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">tag</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">latest</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">env</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">&quot;</span><span style="color:#FFCB6B;">FHIR_SERVER_URL</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">&lt;FHIR-ADDRESS&gt;</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">&quot;</span><span style="color:#FFCB6B;">FHIR_USER</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">&lt;ID&gt;</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">&quot;</span><span style="color:#FFCB6B;">FHIR_PW</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">&lt;PSW&gt;</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"></span></code></pre></div><p>Replace the placeholders with the values of the train image to execute, and other variables with the values corresponding to the stations configuration and paste it into the configuration form shown in the following image.</p><p><a href="/images/station_images/trigger_run_train.png"><img src="`+p+`" alt="image"></a></p><h3 id="running-a-train-with-volume-data" tabindex="-1">Running a train with volume data <a class="header-anchor" href="#running-a-train-with-volume-data" aria-hidden="true">#</a></h3><p>Volume data (any data other than the data stored in the FHIR server) is made available to the train as read only volume mounts. This mount needs to specified in the configuration of the DAG when it is started. The path to which the volume must be mounted is specified in the train.</p><div class="language-json"><button class="copy"></button><span class="lang">json</span><pre><code><span class="line"><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">repository</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">&lt;HARBOR-REGISTRY&gt;/&lt;STATION_NAMESPACE&gt;/&lt;TRAIN-ID&gt;</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">tag</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">latest</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">volumes</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">&quot;</span><span style="color:#FFCB6B;">&lt;Absolute path on station vm&gt;</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">      </span><span style="color:#89DDFF;">&quot;</span><span style="color:#F78C6C;">bind</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">&lt;Mount target in train container&gt;</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">      </span><span style="color:#89DDFF;">&quot;</span><span style="color:#F78C6C;">mode</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">ro</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"></span></code></pre></div>`,26),D=[g];function h(d,u,F,y,A,m){return a(),n("div",null,D)}const C=s(c,[["render",h]]);export{_ as __pageData,C as default};
